	Spawn = function()
		Modelc = Model:clone()
		for _, v in pairs(Modelc:children()) do
			if v.className == "Part" then
				if v.Name ~= "Center" then
					w = Instance.new("Weld")
					w.Part0 = Modelc.Center
					w.Part1 = v
					w.C1 = v.CFrame:inverse() * CFrame.new(v.Position)
					w.C0 = Modelc.Center.CFrame:inverse() * CFrame.new(v.Position)
					w.Parent = w.Part0
				end
			end
		end
		return Modelc
	end
 
