	getWelds = function(c) --designate weld variables
		local t = c.Torso
		local hrp = c.HumanoidRootPart.RootJoint
		RightShoulder = t:FindFirstChild("Right Shoulder")
		LeftShoulder = t:FindFirstChild("Left Shoulder")
		RightHip = t:FindFirstChild("Right Hip")
		LeftHip = t:FindFirstChild("Left Hip")
		RootJoint = hrp
		Neck = t:FindFirstChild("Neck")
	end
	resetWelds = function(ext, occ) --extent 1-3; occlusion
                --1 == reset desiredangle/currentangle
                --2 == reset C0/C1
                --3 == reset both des/cur/c0/c1
		local r = {
			RightShoulder,
			LeftShoulder,
			RightHip,
			LeftHip,
			RootJoint,
			Neck,
			Grip
		}
		for _, v in pairs(r) do
			for i = 1, #occ do
				if occ[i] == v then
					table.remove(r, _)
				end
			end
		end
		for _, v in pairs(r) do
			if v.Name == "Right Shoulder" then
				if ext == 1 then
					v.DesiredAngle = 0
					v.CurrentAngle = 0
				elseif ext == 2 then
					v.C0 = RightShoulderC0
					v.C1 = RightShoulderC1
				elseif ext == 3 then
					v.DesiredAngle = 0
					v.CurrentAngle = 0
					v.C0 = RightShoulderC0
					v.C1 = RightShoulderC1
				end
			elseif v.Name == "Left Shoulder" then
				if ext == 1 then
					v.DesiredAngle = 0
					v.CurrentAngle = 0
				elseif ext == 2 then
					v.C0 = LeftShoulderC0
					v.C1 = LeftShoulderC1
				elseif ext == 3 then
					v.DesiredAngle = 0
					v.CurrentAngle = 0
					v.C0 = LeftShoulderC0
					v.C1 = LeftShoulderC1
				end
			elseif v.Name == "Right Hip" then
				if ext == 1 then
					v.DesiredAngle = 0
					v.CurrentAngle = 0
				elseif ext == 2 then
					v.C0 = RightHipC0
					v.C1 = RightHipC1
				elseif ext == 3 then
					v.DesiredAngle = 0
					v.CurrentAngle = 0
					v.C0 = RightHipC0
					v.C1 = RightHipC1
				end
			elseif v.Name == "Left Hip" then
				if ext == 1 then
					v.DesiredAngle = 0
					v.CurrentAngle = 0
				elseif ext == 2 then
					v.C0 = LeftHipC0
					v.C1 = LeftHipC1
				elseif ext == 3 then
					v.DesiredAngle = 0
					v.CurrentAngle = 0
					v.C0 = LeftHipC0
					v.C1 = LeftHipC1
				end
			elseif v.Name == "Neck" then
				if ext == 1 then
					v.DesiredAngle = 0
					v.CurrentAngle = 0
				elseif ext == 2 then
					v.C0 = NeckC0
					v.C1 = NeckC1
				elseif ext == 3 then
					v.DesiredAngle = 0
					v.CurrentAngle = 0
					v.C0 = NeckC0
					v.C1 = NeckC1
				end
			elseif v.Name == "RootJoint" then
				if ext == 1 then
					v.DesiredAngle = 0
					v.CurrentAngle = 0
				elseif ext == 2 then
					v.C0 = RootJointC0
					v.C1 = RootJointC1
				elseif ext == 3 then
					v.DesiredAngle = 0
					v.CurrentAngle = 0
					v.C0 = RootJointC0
					v.C1 = RootJointC1
				end
			elseif v.Name == "RightGrip" then
				if ext == 1 then
				elseif ext == 2 then
					Grip.C0 = nGrip.C0
					Grip.C1 = nGrip.C1
				elseif ext == 3 then
					Grip.C0 = nGrip.C0
					Grip.C1 = nGrip.C1
				end
			end
		end
	end
 
 
