function COMMANDsFunc(msg)
local find = GetArgs(msg)[1]
for i,v in pairs(commands) do
if msg:lower():sub(1, v.COMMAND:len()) == v.COMMAND:lower() then
local COMMAND = msg:sub(v.COMMAND:len()+2)
v.func(COMMAND)
end
end
end
 

 
