if tickcount > 5 then 
stationary = (Vector3.new(lasttorpos.x,0,lasttorpos.z) - Vector3.new(HRP.Position.x,0,HRP.Position.z)).magnitude < 0.15 
end 
if bvaccel < 0.16 or (chitz == nil and not Alt) or stationary then 
cancelslide = true 
